import TabNavItem from "./AllTabs/TabNavItem";
import TabContent from "./AllTabs/TabContent";
import "./tabs.css"


const Tabs = () => {
  const [activeTab, setActiveTab] = useState("tab1");

  return (
    <>
        <ul className="nav">
        <TabNavItem
          title="Tab 1"
          id="tab1"
          activeTab={activeTab}
          setActiveTab={setActiveTab}
        />
        <TabNavItem
          title="Tab 2"
          id="tab2"
          activeTab={activeTab}
          setActiveTab={setActiveTab}
        />
        <TabNavItem
          title="Tab 3"
          id="tab3"
          activeTab={activeTab}
          setActiveTab={setActiveTab}
        />

        <TabNavItem
          title="Tab 4"
          id="tab4"
          activeTab={activeTab}
          setActiveTab={setActiveTab}
        />
            <TabNavItem
          title="Tab 5"
          id="tab5"
          activeTab={activeTab}
          setActiveTab={setActiveTab}
        />
      </ul>

    <div className="Tabs weatherContainer">

      <div className="outlet">
        <TabContent id="tab1" activeTab={activeTab}>
         <p>it works tab 1</p>
        </TabContent>
        <TabContent id="tab2" activeTab={activeTab}>
          <p>Tab 2 works!</p>
        </TabContent>
        <TabContent id="tab3" activeTab={activeTab}>
          <p>Tab 3 works!</p>
        </TabContent>
        <TabContent id="tab4" activeTab={activeTab}>
          <p>tab4 works!</p>
        </TabContent>
      </div>
    </div>
    </>
  );
};

export default Tabs;
